import React from 'react'
import Form from './Form'
function Contact(){
    const flex={
        display:'flex',
        flexWrap:'wrap'
        
            }
            const hari={
                color:'black',
                marginTop:'200px',
                fontSize:'40px'
            }
    return(
        <>

<main style={flex}>
    <div id='form' style={{display:'none',marginTop:'100px'}} >
                 <Form/></div>
            <div style={hari}>
                <i class='fa fa-facebook-square'></i>
                <i class='fa fa-twitter-square'></i>
                <i class='fa fa-reddit-square'></i>
                <i class='fa fa-linedin-square'></i>
                <i class='fa fa-instagram-square'></i>
                <i class='fa fa-google-square'></i>
             </div>
            </main>
        </>
    );
}
export default Contact;
